import { Component, Inject } from '@angular/core';
import { FormsModule, NgForm } from '@angular/forms';
import { IUser } from '../models/interfaces';
import { MAT_DIALOG_DATA, MatDialogRef } from '@angular/material/dialog';

@Component({
  selector: 'app-dialog-edit-info',
  templateUrl: './dialog-edit-info.component.html',
  styleUrls: ['./dialog-edit-info.component.less']
})
export class DialogEditInfoComponent {
  user: IUser = {
    id: -1,
    role: "user",
    name: "",
    lastName: "",
    quote: "",
    birthday: "",
    nativeCity: "",
    email: "" ,
    status: "unconfirmed",
    friends: [],
    password: ""
}

  constructor(@Inject(MAT_DIALOG_DATA) public data : any, private ref : MatDialogRef<DialogEditInfoComponent>){
    this.user.id = this.data.id;
    this.user.role = this.data.role;
    this.user.name = this.data.name;
    this.user.lastName = this.data.lastName;
    this.user.quote = this.data.quote;
    this.user.birthday = this.data.birthday;
    this.user.nativeCity = this.data.nativeCity;
    this.user.email = this.data.email;
    this.user.status = this.data.status;
    this.user.friends = this.data.friends.slice(0);
    this.user.password = this.data.password
  }

  IsEmpty() : boolean{
    if(this.user.name=='' || this.user.lastName == '' || this.user.quote == '' || this.user.birthday == '' || this.user.nativeCity == ''){
      return true;
    }
    return false;
  }
}
<h2 mat-dialog-title>Расскажите о себе, {{ data.name }}</h2>
<mat-dialog-content>
    <form>
        <div class="form">
            <label for="name">Имя</label>
            <input placeholder="Незаполненное поле!!!" [(ngModel)]="this.user.name" [ngClass]="{'empty' : this.user.name==''}" name="name">

            <label for="lastName">Фамилия</label>
            <input placeholder="Незаполненное поле!!!" [(ngModel)]="this.user.lastName" [ngClass]="{'empty' : this.user.lastName==''}" name="lastName">

            <label for="birthday">Дата рождения</label>
            <input placeholder="Незаполненное поле!!!" [(ngModel)]="this.user.birthday" [ngClass]="{'empty' : this.user.birthday==''}" name="birthday">

            <label for="nativeCity">Город</label>
            <input placeholder="Незаполненное поле!!!" [(ngModel)]="this.user.nativeCity" [ngClass]="{'empty' : this.user.nativeCity==''}" name="nativeCity">

            <label for="quote">Любимая цитата</label>
            <input placeholder="Незаполненное поле!!!" [(ngModel)]="this.user.quote" [ngClass]="{'empty' : this.user.quote==''}" name="quote">
        </div>
    </form>
</mat-dialog-content>
<mat-dialog-actions>
    <button mat-button [mat-dialog-close]="this.user" [disabled]="IsEmpty()">Сохранить</button>
    <button mat-button [mat-dialog-close] ="null">Отменить</button>
</mat-dialog-actions>
